/* Hide subreddits top bar */

.sr-list > .separator,
.sr-list > .separator + .sr-bar,
#sr-more-link {
	display: none !important;
}
#sr-header-area {
	height: 0 !important;
}
.sr-bar,
.dropdown.srdrop {
	float: right !important;
	margin-left: 1em;
}
/* Hide annoying stuff */
.give-gold-button,
.goldvertisement,
.embed-comment,
.nub {
	display: none !important;
}
/* Reset */
*, *:before, *:after {
	background-color: transparent !important;
	border: none !important;
	color: #777 !important;
}
/* Default links */
a {
	color: #48b !important;
}
a:visited {
	color: #369 !important;
}
a:hover {
	color: #5ad !important;
}
/* Background */
html,
body,
#sr-more-link {
	background-color: #222 !important;
}
/* Top bar */
#header-img,
#mail,
.sidebox.create .spacer a {
	filter: invert(80%) hue-rotate(180deg) !important;
}
.drop-choices,
.hover-bubble,
.modal-dialog {
	background: #111 !important;
}
.tabmenu .selected a {
	color: #999 !important;
}
/* Side bar */
.listing-chooser-collapsed .grippy {
	width: 1px !important;
}
.listing-chooser-collapsed .listing-chooser {
	padding-right: 1px !important;
}
.listing-chooser li.selected {
	box-shadow: none !important;
}
.grippy:after {
	display: none !important;
}
/* Inputs and buttons */
input,
textarea,
.linkinfo .shortlink input,
.new-comment .usertext-body,
.morelink a,
.morelink:hover a,
.fancy-toggle-button a,
.usertext button {
	background: #333 !important;
	color: #999 !important;
	font-weight: normal !important;
}
/* Listing */
.thing .title {
	color: #aaa !important;
}
.title:visited {
	color: #777 !important;
}
.thing .title:hover {
	color: #ccc !important;
}
.arrow {
